F is for Fucked 

Jacky Joy &amp; Christie Stevens, Johnny Sins 

da Doctor Adventures November 15, 2012






Christie and Jacky are first year med students who get paired up in anatomy class and manage to fail their first assignment. Prof Dr. Johnny decides to play patient to determine who will go further for the perfect grade.



